INSERT INTO `Board` VALUES (1,'안녕하세요 코로나 증상 관련해서 공유하려고 글작성 합니다 다들 반갑습니다!','2022-04-07 16:11:40.322000','첫 글 작성','1e5c69ec-429a-41b8-9481-238f927a1ce5'),(2,'저는 열이 엄청 나고 아파서 죽는줄 알았어요 ㅠㅠ\n\n혹시 저 같은 경험 있으신분 계신가요??\n\n죽는줄 알았습니다','2022-04-07 16:15:46.553000','백신 3차 접종 하신분??','26dc0540-2477-4338-abb5-55d15ef8b9dd'),(3,'잘 부탁합니다 여러분 히히히히히\n\n<br>\n','2022-04-07 16:18:01.473000','여기가 그 유명한 척척박사???','44217f44-9d26-44d3-96b9-f810604d6b3b'),(4,'예를 들어 초식공룡이랑 육식공룡이 있는데 백신을 맞으면 초식공룡처럼 힘이 약해지구요 안맞으면....','2022-04-07 16:22:56.974000','여러분 백신 맞지 마세요 백신을 맞으면','a5790790-ef18-4de8-aa30-0fdee27eaf27'),(6,'다들 코로나 증상 어떠세요\n저는 며칠전부터 코도 간지럽고목이 좀 불편한 느낌이 들길래 그냥 감기라고 생각하고 넘겼거든요 그런데 시간이 지날수록 두통도 생기고 열도 나면서 몸에 오한이 오는 느낌이 들더라구요ㅜㅜ\n혹시나 하는 마음에 근처 선별소가서pcr검사 받아봤는데 두줄이결국 올게 왔구나 싶었어요\n코로나 증상 없이 그냥 지나치는 분들도많다고 하던데 저는 예외인건지목소리도 완전 쉰목소리로 바뀌고몸살난거 처럼 열나고 근육통까지 오니살짝 겁나더라구요ㅜ\n근처 약국에서 상비약들 여러개준비해두고 더 아파지기 전에 매일 챙겨먹는데처음 며칠간은 정말 힘들었어요\n감기처럼 약먹고 쉬면 괜찮아지겠지 했는데기침 심해지거나 할때는 가끔 숨쉬기가힘들 때가 있어서 산소포화도 측정해주는기계도 준비해두고 코로나 증상 나타날 때마다수시로 체크해주고 있네요 \n요즘 재택치료하는 분들이 많아졌는데기저질환 있거나 60세 이상이신 분 아니면지급이 되지 않는게 많이 있더라고요 \n산소포화도 측정기도 지급대상 아니라미리 준비하지 않으면 품절된다고 해서늦기전에 주문했는데 다행히 하루만에 받았어요\n평소에 코로나 증상 없을 때는9698 수치가 나오다가도 상태가 안좋을때 체크하면93까지도 떨어지더라구요ㅠ\n90이하로 떨어지면 저산소증으로위급할 수 있어서 바로 병원으로가야하는 상황이라고 해요\n그래도 이렇게 집에서 간편하게 코로나 증상이 있을 때 현재 몸상태를 바로 체크해볼 수 있어서조금 안심이 되는거 같아요 \n코로나 증상이 조금이라도 있으시다면더 심각해지기 전에 빨리 검사해보시고필요한 물품들은 미리 준비해두셔서빠른 대처하는게 제일 좋은거 같아요\n도움이 되실까 해서 자가격리하면서필요한 상비약들 정리해둔 내용들첨부해드릴테니 참고해보세요\n이제 곧 자가격리 기간도 끝나가네요이미 확진받으신 분들은 많이 걱정되시고힘드시겠지만 코로나 증상이 있는 때일수록 약 잘먹고잘 쉬셔서 모두 별탈없이 회복되시길 바랄게요','2022-04-07 16:30:01.279000','가볍지 않은 코로나 증상','44217f44-9d26-44d3-96b9-f810604d6b3b'),(8,'코로나 확진 받으셨던 분들 코로나증상 보통 며칠씩 가셨나요??\n내일까지 격리고 모래부터 격리해제인데 저는 오늘 몸상태가 제일 않좋은거 같아요ㅠ\n그래도 증상이 경미해서 다행이다 했는데 경미한증상이 약을 먹어도 크게 호전되는거 같지 않고 어제랑 오늘은 감기몸살처럼 몸상태가 더 않좋네요','2022-04-07 16:33:31.652000','코로나 증상','a5790790-ef18-4de8-aa30-0fdee27eaf27'),(9,'애기들은 학교원에서 확진자 나와도 안걸리고잘넘어갔는데 애기아빠가 회사에 확진자 있다더니어제부터 열이나네요\n\n열나고 목아프고 머리아프고 오한오고 몸살끼있고\n\n증상만 보면 코로나인데증상나타나고도 3번 자가키트했는데음성이 나와요 \n\n코로나는 몸에 증상나타나면키트에도 양성뜨나요아님 증상나타나도 음성뜰수있을까요\n\n9시에 병원 문열면 바로가서 검사할꺼긴한데신속도 정확도가 떨어진다고 들어서pcr로 해달라고 할껀데 해주겠죠?','2022-04-07 16:34:26.618000','코로나 증상이요','1e5c69ec-429a-41b8-9481-238f927a1ce5'),(10,'지금까진 주변에서 코로나 증상으로 크게 아프다는 경우를 못들어서 단순 감기 증상인가보다 하고 알고 있었는데 얼마전에 확진된 친구는 열이 펄펄 끓고 너무 아프다고 그러네요 절대 단순 감기 증상이랑은 차원이 다르다고 3차를 안 맞은 친구인데 그래서 증상이 심한건지넘 무섭네요 다들 코로나 조심하셔요 ㅠㅠ','2022-04-07 16:35:02.060000',' 코로나 증상 정말 재각각','44217f44-9d26-44d3-96b9-f810604d6b3b'),(13,'그전까진 달마다 그날 생리주기가 딱 맞게 시작했거든요 백신 1차 2차때도요 근데 백신 3차 맞은 후 그날이 지났는데 소식이 없어요 느낌상 할거 같은 증조는 보이는데이게 부작용 일까요 ㅠㅠ 찾아보니 3차 맞으시고 몇달후 하신분들도 계시더라구요 병원을 가봐야 하는걸까요 ㅠㅠ','2022-04-07 16:40:48.616000','백신 부작용인가요 ㅠㅠ','a5790790-ef18-4de8-aa30-0fdee27eaf27'),(14,'단유 후 노바백스 1차 맞았고노바백스 접종 일주일이 되던 날 밤에백신 부작용 증상이 나타나기 시작했어요\n의사 선생님이 진료하시더니두드러기가 맞다고 하시네요\n백신 접종 후 두드러기가 발생할 수 있지만음식 알레르기 때문에 발생할 수 있고특발성 이라고 해서원인불명으로 갑자기나타날 수도 있기 때문에코로나백신부작용 이라고 100 확신할 수 없다고 하셨어요\n저는 어떤 예방주사든지백신 부작용을 겪어본 적이 없고음식 알레르기도 없거든요결국 아프면 나만 고생하고 돈만 써요진료비와 약값 모두 본인 부담입니다\n엉덩이 주사 2대를 맞고 원무과에서 수납을 했어요약국에서 먹는 약 일주일치를 받았어요의사 선생님께서 바르는 약도 물어보셨는데환부가 워낙 많고생후9개월아기가 제 피부를 만질 수 있기 때문에바르는 약은 받지 않았어요 \n제가 단유 후코로나 백신 부작용을 겪어보니까임산부 코로나 백신 또는모유수유 코로나 백신을 맞은 뒤부작용이 나타나서 치료를 해야될 때 아이에게 영향을 줄 수 있기 때문에문제가 될 수 있겠어요\n제가 먹는 약에도모유수유금지 약물이 포함되어 있어서모유 수유 중에 코로나 백신을 맞고부작용을 겪었다면난감했겠다는 생각이 들어요임산부나 수유부는 면역력이 약하기 때문에백신 부작용까지 고려해서백신 접종 여부를 결정해야겠어요\n\n','2022-04-07 16:43:58.768000','백신 부작용 의심 증상으로 두드러기 5일째','44217f44-9d26-44d3-96b9-f810604d6b3b'),(17,'백신 맞고 거의 매일 비슷한 종류의 증상 있으면백신 부작용 빼박 아님물론 일상생활에 지장은 1도 없음아무튼오늘 검사하고 왔는데 의사가 할매라딴소리만 해대고 별로 안 알아보고 간거 후회중임일단 피검사는 기다려야 될것 같고그외결과는 특이사항 안 잡힌듯내 증상을 얘기하자면ㅅㅂ 할매의사는 들으려 하지도 않고자기가 더 잘 알지 나나 기자가 잘 알겠냐고 ㅈㄹ하더라동네병원 수듄 ㅋㅋ무슨 변비로 속이 답답한거다 이러는데 ㅋㅋ 말이 되냐고각설하고 ㅋㅋ 딴얘기가 길었네 내 증상은1 백신 맞은 당일은 별 이상 없었음2 그 다음날부터 심장 쪽이 불편3 백신 이후 1달간 코피 ㅈㄴ 흘림4 심장 두근댐5 심장 쪽이 경련 비슷하게 남6 요즘은 걍 주로 아침에 답답함7 뭔가 안에 뭔가 느껴지는 느낌8 단거리인데도 빨리 걸으면 힘들다가보다 ㅈㄴ 헉헉댐ㅅㅂ 이거 빼박 백신 부작용이지부정맥인거 같은데내소신은 원래 백신 안맞고 버티기였는데가족이 하도 맞으라 해서 1월 초에 맞았는데 ㅋㅋㅅㅂ 내 소신 지킬걸','2022-04-07 16:44:59.323000','읽어줘 백신부작용 맞는거같은데 ','1e5c69ec-429a-41b8-9481-238f927a1ce5'),(18,'둘째만 확진이라서\n방에 둘째와 같이 격리중이고\n첫째는 아빠와 생활중인데요동거인 pcr 음성이라고 오늘 문자를 받았는데첫째가 배가 아프다그러더니 조금 있다가 구토를 했대요\n열은 없다는데 혹시몰라서 쫌이따 키트검사해보긴할거에요잠들었대서 코로나 증상 검색해보니 고열등이 있고 구토증상인거같은데 \n열나지않고 구토증상만 있기도 하나요ㅠ ','2022-04-07 16:48:17.384000','코로나 증상중에 구토','26dc0540-2477-4338-abb5-55d15ef8b9dd'),(20,'이젠 코로나 안걸린 사람이 신기한 세상이 된듯하네요ㅜ \n\n코로나 확진 증상도 사람마다 다르고 강도도 다르고\n\n여기서 드는 궁금중이 확진자중 백신 안맞은 사람들과 백신 3차까지 맞은 사람들중 증상 강도가 어떨끼요\n\n 백신 3차까지 맞았는데 확진 증상 심하게 온사람들 있나요\n\n 주위보니 백신 안맞은 어른이나 아이들은 심하게 증상 오고백신 3차까지 맞은 사람들은 걸려도 좀 수월하게 지나가는거같아서요','2022-04-07 17:06:59.951000','코로나 증상 강도와 백신 3차 연관성        ','26dc0540-2477-4338-abb5-55d15ef8b9dd'),(22,'어제부터 몸이 안좋아서 선별진료소에서 검사를 받았는데 확진판정 받았습니다. \n\n증상은 오한, 발열, 기침이 있네요 \n\n의외로 미각, 후각은 멀쩡하더군요; \n\n다들 증상 어떠신가요??','2022-04-07 17:33:01.203000',' 코로나19 확진 그리고 증상','1e5c69ec-429a-41b8-9481-238f927a1ce5');
